import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props) {
        super(props);
    }

   getData(){
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                console.log('text decoded:', text);
            });
    }
}
